function onChartDrag(evt) {
    var xDelta = evt.offsetX - this.startXDrag,
        yDelta = evt.offsetY - this.startYDrag,
        lngStart = this.lngStart,
        latStart = this.latStart,
        scale = this.scaleFactor * 8,
        newLng =  (((lngStart - xDelta / scale)%360)+360)%360, // js modulo bug fix
        newLat =  (((latStart + yDelta / scale)%360)+360)%360,
        latSlider = this.latSlider,
        lngSlider =  this.lngSlider,
        chart = this.owner.owner.chartMorph;

    // workaround to avoid a double update triggered by both sliders
    lively.bindings.noUpdate({sourceObj: latSlider, sourceAttribute: 'value',
        targetObj: this, targetAttribute: 'originLat'},
        function() {
            latSlider.value = newLat;
        });
    this.originLat = Math.floor(newLat) - 180;
    lngSlider.value = newLng;
}

