1418.source:
function drawDimensions(context, dimensions, scales, areas) {
    var drawingPanes = [],
        xTickCount = this.xTickCount,
        makeDrawingPane = this.makeDrawingPane,
        drawingAreas = context.selectAll('g.chart-group')
            .data(areas),
        module = this;

    drawingAreas.enter()
        .append('svg:g')
        .attr('class', 'chart-group');
    drawingAreas.exit()
        .remove();

    drawingAreas.each(function(d, i){
        var drawingPane = makeDrawingPane(this, d);

        if (scales.loc) { // do we have a geo scale?
            var scale = scales.loc[i] || scales.loc.first(),
                world = drawingPane.selectAll('g.world').data([1]),
                path = d3.geo.path().projection(scale),
                clip = scale.origin ?
                    // If we deal with an azimuthal projection we want to
                    // draw only the geo data which is on the visible half
                    // of the earth
                    function(d) {
                        return path(d3.geo.greatCircle()
                            .origin(scale.origin())
                            .clip(d));
                    } :
                    function(d) {return path(d)};

            world.enter().append('svg:g').attr('class','world');
            world.exit().remove();

            var drawStates = function(json) {
                    var states = world.selectAll("path.state")
                            .data(json.features);
                    states.enter()
                        .append("svg:path")
                        .attr("class", 'state');
                    states.exit()
                        .remove();
                    states.attr("d", clip);

                    states.each(function(d){
                        var title = d3.select(this)
                                .selectAll('title').data([1]);
                        title.enter()
                            .append('svg:title')
                            .text(function() { return d.properties.name; })
                    });

                    module.statesData = json;
                };
            if (module.statesData) {
                drawStates(module.statesData);
            } else {
                d3.json("data-exploration/world-countries.json", drawStates);
            }
        } else {
            console.warn('Cannot draw map when no projection is defined');
        }
        drawingPanes.push(drawingPane);
    });
    return drawingPanes;
}

1422.source:
function makeDrawingPane(context, area) {
    // Creates a drawing pane which is clipped by a path, defined by an area
    // (i.e. the actual chart canvas of a line chart, limited by the axes).
    var clipId = 'clip-' + Math.floor(Math.random()*0x10000).toString(16),
        left = area.x,
        top = area.y,
        w = area.width,
        h = area.height;

    // Make sure we have a clip path
    var clipPath = d3.select(context).selectAll('clipPath.chart-content')
            .data([1]);
    clipPath.enter()
            .append("svg:clipPath")
            .attr('class', 'chart-content')
            .append("svg:rect")
    clipPath.exit().remove();
    clipPath.attr("id", clipId);
    clipPath.select('rect')
            .attr("width", w)
            .attr("height", h);

    // Make sure we have a drawing pane connected to that clipPath
    var drawingPane = d3.select(context).selectAll('g.drawing-pane')
            .data([1]);
    drawingPane.enter()
            .append("svg:g")
            .attr('class', 'drawing-pane');
    drawingPane.exit().remove();
    drawingPane.attr("clip-path", "url(#"+clipId+")")
            .attr("transform", "translate(" + left + "," + top + ")");

    return drawingPane;

}

